type: string
enum:
  - ALREADY_EXISTS
  - FAILED_PRECONDITION
  - INTERNAL
  - INVALID_ARGUMENT
  - NOT_FOUND
  - PERMISSION_DENIED
  - RESOURCE_EXHAUSTED
  - UNAUTHENTICATED
  - UNAVAILABLE
description: |
  Error type:
  
  - `ALREADY_EXISTS` - Already exists
  - `FAILED_PRECONDITION` - Failed precondition
